import React, { Component } from "react";
import "./App.css";
import Splash from "../src/splash/splash";
import { Route, Switch } from "react-router-dom";

export default class App extends Component {
  state = {
    isLoggedIn: false
  };
  render() {
    return (
      <div>
        <Switch>
          {!isLoggedIn && (
            <Route path="/" component={() => <Splash></Splash>}></Route>
          )}
        </Switch>
      </div>
    );
  }
}
